import{_ as o,o as e,c as d,Q as l}from"./chunks/framework.98c15f2e.js";const f=JSON.parse('{"title":"MacOS快捷键","description":"","frontmatter":{"title":"MacOS快捷键","author":"周一","date":"2022+09+24","categories":"+ 学习干货","tags":"+ MacOS快捷键","sidebar":"auto"},"headers":[{"level":2,"title":"序言","slug":"序言","link":"#序言","children":[]},{"level":2,"title":"剪切、拷贝、粘贴和其他常用快捷键","slug":"剪切、拷贝、粘贴和其他常用快捷键","link":"#剪切、拷贝、粘贴和其他常用快捷键","children":[]},{"level":2,"title":"睡眠、退出登录和关机快捷键","slug":"睡眠、退出登录和关机快捷键","link":"#睡眠、退出登录和关机快捷键","children":[]},{"level":2,"title":"访达和系统快捷键","slug":"访达和系统快捷键","link":"#访达和系统快捷键","children":[]},{"level":2,"title":"文稿快捷键","slug":"文稿快捷键","link":"#文稿快捷键","children":[]},{"level":2,"title":"其他快捷键","slug":"其他快捷键","link":"#其他快捷键","children":[]},{"level":2,"title":"进一步了解","slug":"进一步了解","link":"#进一步了解","children":[]}],"relativePath":"column/BaseCommand/MacShortcutKey/002_macos.md","filePath":"column/BaseCommand/MacShortcutKey/002_macos.md","lastUpdated":1665832342000}'),c={name:"column/BaseCommand/MacShortcutKey/002_macos.md"},i=l('<h2 id="序言" tabindex="-1">序言 <a class="header-anchor" href="#序言" aria-label="Permalink to &quot;序言&quot;">​</a></h2><p>这里附上<code>apple</code>官网所撰写的一些快捷键：<a href="https://support.apple.com/zh+cn/HT201236%EF%BC%8C%E4%B8%8B%E9%9D%A2%E5%B0%86%E6%95%B4%E7%90%86%E5%91%A8%E4%B8%80%E5%9C%A8%E4%BD%BF%E7%94%A8%E8%BF%87%E7%A8%8B%E4%B8%AD%E6%AF%94%E8%BE%83%E5%B8%B8%E8%A7%81%E7%9A%84%E5%BF%AB%E6%8D%B7%E9%94%AE%E3%80%82" target="_blank" rel="noreferrer">https://support.apple.com/zh+cn/HT201236，下面将整理周一在使用过程中比较常见的快捷键。</a></p><h2 id="剪切、拷贝、粘贴和其他常用快捷键" tabindex="-1">剪切、拷贝、粘贴和其他常用快捷键 <a class="header-anchor" href="#剪切、拷贝、粘贴和其他常用快捷键" aria-label="Permalink to &quot;剪切、拷贝、粘贴和其他常用快捷键&quot;">​</a></h2><ul><li><code>Command+X</code>：剪切所选项并拷贝到剪贴板。</li><li><code>Command+C</code>：将所选项拷贝到剪贴板。这同样适用于“访达”中的文件。</li><li><code>Command+V</code>：将剪贴板的内容粘贴到当前文稿或 <code>App</code> 中。这同样适用于“访达”中的文件。</li><li><code>Command+Z</code>：撤销上一个命令。随后您可以按 <code>Shift+Command+Z</code> 来重做，从而反向执行撤销命令。在某些 <code>App</code> 中，您可以撤销和重做多个命令。</li><li><code>Command+A</code>：全选各项。</li><li><code>Command+F</code>：查找文稿中的项目或打开“查找”窗口。</li><li><code>Command+G</code>：再次查找：查找之前所找到项目出现的下一个位置。要查找出现的上一个位置，请按 <code>Shift+Command+G</code>。</li><li><code>Command+H</code>：隐藏最前面的 <code>App</code> 的窗口。要查看最前面的 <code>App</code> 但隐藏所有其他 <code>App</code>，请按 <code>Option+Command+H</code>。</li><li><code>Command+M</code>：将最前面的窗口最小化至“程序坞”。要最小化最前面的 <code>App</code> 的所有窗口，请按 <code>Option+Command+M</code>。</li><li><code>Command+O</code>：打开所选项，或打开一个对话框以选择要打开的文件。</li><li><code>Command+P</code>：打印当前文稿。</li><li><code>Command+S</code>：存储当前文稿。</li><li><code>Command+T</code>：打开新标签页。</li><li><code>Command+W</code>：关闭最前面的窗口。要关闭 <code>App</code> 的所有窗口，请按下 <code>Option+Command+W</code>。</li><li><code>Option+Command+Esc</code>：<a href="https://support.apple.com/zh+cn/HT201276" target="_blank" rel="noreferrer">强制退出</a> <code>App</code>。</li><li><code>Command+空格键</code>：显示或隐藏“<a href="https://support.apple.com/zh+cn/HT204014" target="_blank" rel="noreferrer">聚焦</a>”搜索栏。要从“访达”窗口执行“聚焦”搜索，请按 <code>Command+Option+空格键</code>。（如果您<a href="https://support.apple.com/zh+cn/guide/mac+help/type+language+mac+input+sources+mchlp1406/mac" target="_blank" rel="noreferrer">使用多个输入源</a>以便用不同的语言键入内容，这些快捷键会更改输入源而非显示“聚焦”。了解如何<a href="https://support.apple.com/zh+cn/guide/mac+help/change+a+conflicting+keyboard+shortcut+on+mac+mh35591/mac" target="_blank" rel="noreferrer">更改冲突的键盘快捷键</a>。）</li><li><code>Control+Command+空格键</code>：显示字符检视器，您可以从中选择<a href="https://support.apple.com/zh+cn/HT201586" target="_blank" rel="noreferrer">表情符号和其他符号</a>。</li><li><code>Control+Command+F</code>：全屏使用 <code>App</code>（如果 <code>App</code> 支持）。</li><li>空格键：使用“<a href="https://support.apple.com/zh+cn/guide/mac+help/view+and+edit+files+with+quick+look+mh14119/mac" target="_blank" rel="noreferrer">快速查看</a>”来预览所选项。</li><li><code>Command+Tab</code>：在打开的 <code>App</code> 中切换到下一个最近使用的 <code>App</code>。</li><li><code>Shift+Command+5</code>：在 <a href="https://support.apple.com/zh+cn/HT201260" target="_blank" rel="noreferrer">macOS Mojave 或更高版本</a>中，拍摄截屏或录制屏幕。也可以使用 <code>Shift+Command+3</code> 或 <code>Shift+Command+4</code> 来拍摄截屏。<a href="https://support.apple.com/zh+cn/HT201361" target="_blank" rel="noreferrer">进一步了解截屏</a>。</li><li><code>Shift+Command+N</code>：在“访达”中创建一个新文件夹。</li><li><code>Command+,</code>：打开最前面的 <code>App</code> 的偏好设置。</li></ul><h2 id="睡眠、退出登录和关机快捷键" tabindex="-1">睡眠、退出登录和关机快捷键 <a class="header-anchor" href="#睡眠、退出登录和关机快捷键" aria-label="Permalink to &quot;睡眠、退出登录和关机快捷键&quot;">​</a></h2><p>在这些快捷键中，您可能需要按住其中一些快捷键稍长时间。这样有助于避免无意中启用快捷键。</p><ul><li><code>电源按钮</code>：按下可将 Mac 开机或将 Mac 从睡眠状态唤醒。按住这个按钮 <code>1.5 秒</code>可使 <code>Mac</code> 进入睡眠状态*。继续按住则会强制 <code>Mac</code> 关机。</li><li><code>Option+Command+电源按钮*</code> 或 <code>Option+Command+Media Eject（Option+Command+介质推出键）🔼</code>：将您的 <code>Mac</code> 置于睡眠状态。</li><li><code>Control+Shift+电源按钮*</code> 或 <code>Control+Shift+Media Eject（Control+Shift+介质推出键）🔼</code>：将显示器置于睡眠状态。</li><li><code>Control+电源按钮*</code> 或 <code>Control+介质推出键🔼</code>：显示一个对话框，询问您是要重新启动、睡眠还是关机。</li><li><code>Control+Command+电源按钮*</code>：强制 <code>Mac</code> 重新启动，系统不会提示是否要存储任何打开且未存储的文稿。</li><li><code>Control+Command+Media Eject（Control+Command+介质推出键）🔼</code>：退出所有 <code>App</code>，然后重新启动您的 <code>Mac</code>。如果任何打开的文稿有未存储的更改，系统会询问您是否要存储这些更改。</li><li><code>Control+Option+Command+电源按钮*</code> 或 <code>Control+Option+Command+介质推出键🔼</code>：退出所有 <code>App</code>，然后将您的 Mac 关机。如果任何打开的文稿有未存储的更改，系统会询问您是否要存储这些更改。</li><li><code>Control+Command+Q</code>：立即锁定屏幕。</li><li><code>Shift+Command+Q</code>：退出登录您的 <code>macOS</code> 用户帐户。系统将提示您确认。要在不确认的情况下立即退出登录，请按下 <code>Option+Shift+Command+Q</code>。</li></ul><h2 id="访达和系统快捷键" tabindex="-1">访达和系统快捷键 <a class="header-anchor" href="#访达和系统快捷键" aria-label="Permalink to &quot;访达和系统快捷键&quot;">​</a></h2><ul><li><code>Command+D</code>：复制所选文件。</li><li><code>Command+E</code>：推出所选磁盘或宗卷。</li><li><code>Command+F</code>：在“访达”窗口中开始“聚焦”搜索。</li><li><code>Command+I</code>：显示所选文件的“显示简介”窗口。</li><li><code>Command+R</code>：(1) 如果在“访达”中选择了某个别名：显示所选别名对应的原始文件。(2) 在某些 <code>App</code>（如“日历”或 Safari 浏览器）中，刷新或重新载入页面。(3) 在<a href="https://support.apple.com/zh+cn/HT201541" target="_blank" rel="noreferrer">“软件更新”偏好设置</a>中，再次检查有没有软件更新。</li><li><code>Shift+Command+C</code>：打开“电脑”窗口。</li><li><code>Shift+Command+D</code>：打开“桌面”文件夹。</li><li><code>Shift+Command+F</code>：打开“最近使用”窗口，其中显示了您最近查看或更改过的所有文件。</li><li><code>Shift+Command+G</code>：打开“前往文件夹”窗口。</li><li><code>Shift+Command+H</code>：打开当前 <code>macOS</code> 用户帐户的个人文件夹。</li><li><code>Shift+Command+I</code>：打开 <code>iCloud</code> 云盘。</li><li><code>Shift+Command+K</code>：打开“网络”窗口。</li><li><code>Option+Command+L</code>：打开“下载”文件夹。</li><li><code>Shift+Command+N</code>：新建文件夹。</li><li><code>Shift+Command+O</code>：打开“文稿”文件夹。</li><li><code>Shift+Command+P</code>：在“访达”窗口中显示或隐藏预览面板。</li><li><code>Shift+Command+R</code>：打开“隔空投送”窗口。</li><li><code>Shift+Command+T</code>：显示或隐藏“访达”窗口中的标签页栏。</li><li><code>Ctrl+Shift+Command+T</code>：将所选的“访达”项目添加到“程序坞”（<code>OS X Mavericks</code> 或更高版本）</li><li><code>Shift+Command+U</code>：打开“实用工具”文件夹。</li><li><code>Option+Command+D</code>：显示或隐藏“程序坞”。</li><li><code>Control+Command+T</code>：将所选项添加到边栏（<code>OS X Mavericks</code> 或更高版本）。</li><li><code>Option+Command+P</code>：隐藏或显示“访达”窗口中的路径栏。</li><li><code>Option+Command+S</code>：隐藏或显示“访达”窗口中的边栏。</li><li><code>Command+斜线 (/)</code>：隐藏或显示“访达”窗口中的状态栏。</li><li><code>Command+J</code>：显示“显示”选项。</li><li><code>Command+K</code>：打开“连接服务器”窗口。</li><li><code>Control+Command+A</code>：为所选项制作替身。</li><li><code>Command+N</code>：打开一个新的“访达”窗口。</li><li><code>Option+Command+N</code>：新建智能文件夹。</li><li><code>Command+T</code>：在当前“访达”窗口中有单个标签页开着的状态下显示或隐藏标签页栏。</li><li><code>Option+Command+T</code>：在当前“访达”窗口中有单个标签页开着的状态下显示或隐藏工具栏。</li><li><code>Option+Command+V</code>：将剪贴板中的文件从原始位置移动到当前位置。</li><li><code>Command+Y</code>：使用“快速查看”预览所选文件。</li><li><code>Option+Command+Y</code>：显示所选文件的快速查看幻灯片显示。</li><li><code>Command+1</code>：以图标方式显示“访达”窗口中的项目。</li><li><code>Command+2</code>：以列表方式显示“访达”窗口中的项目。</li><li><code>Command+3</code>：以分栏方式显示“访达”窗口中的项目。</li><li><code>Command+4</code>：以画廊方式显示“访达”窗口中的项目。</li><li><code>Command+左中括号 ([)</code>：前往上一文件夹。</li><li><code>Command+右中括号 (])</code>：前往下一个文件夹。</li><li><code>Command+上箭头</code>：打开包含当前文件夹的文件夹。</li><li><code>Command+Control+上箭头</code>：在新窗口中打开包含当前文件夹的文件夹。</li><li><code>Command+下箭头</code>：打开所选项。</li><li><code>右箭头</code>：打开所选文件夹。这个快捷键仅在列表视图中有效。</li><li><code>左箭头</code>：关闭所选文件夹。这个快捷键仅在列表视图中有效。</li><li><code>Command+Delete</code>：将所选项移到废纸篓。</li><li><code>Shift+Command+Delete</code>：清倒废纸篓。</li><li><code>Option+Shift+Command+Delete</code>：清倒废纸篓而不显示确认对话框。</li><li><code>Command+调低亮度</code>：当 Mac 连接到多台显示器时，打开或关闭视频镜像功能。</li><li><code>Option+调高亮度</code>：打开“显示器”偏好设置。这个快捷键可与任一亮度键搭配使用。</li><li><code>Control+调高亮度或 Control+调低亮度</code>：更改外部显示器的亮度（如果显示器支持）。</li><li><code>Option+Shift+调高亮度或 Option+Shift+调低亮度</code>：以较小的步幅调节显示器亮度。如果您的显示器支持，可以将 Control 键添加到此快捷键，以便在外置显示器上进行调节。</li><li><code>Option+“调度中心”</code>：打开“调度中心”偏好设置。</li><li><code>Command+“调度中心”</code>：显示桌面。</li><li><code>Control+下箭头</code>：显示最前面的 App 的所有窗口。</li><li><code>Option+调高音量</code>：打开“声音”偏好设置。这个快捷键可与任一音量键搭配使用。</li><li><code>Option+Shift+调高音量或 Option+Shift+调低音量</code>：以较小的步幅调节音量。</li><li><code>Option+键盘调高亮度</code>：打开“键盘”偏好设置。这个快捷键可与任一键盘亮度键搭配使用。</li><li><code>Option+Shift+键盘调高亮度或 Option+Shift+键盘调低亮度</code>：以较小的步幅调节键盘亮度。</li><li><code>连按 Option 键</code>：在单独的窗口中打开项目，然后关闭原始窗口。</li><li><code>连按 Command 键</code>：在单独的标签页或窗口中打开文件夹。</li><li><code>按住 Command 键拖移到另一个宗卷</code>：将拖移的项目移到另一个宗卷，而不是拷贝它。</li><li><code>按住 Option 键拖移</code>：拷贝托移的项目。拖移项目时指针会随之变化。</li><li><code>拖移时按住 Option+Command</code>：为拖移的项目制作替身。拖移项目时指针会随之变化。</li><li><code>按住 Option 键点按开合三角</code>：打开所选文件夹内的所有文件夹。这个快捷键仅在列表视图中有效。</li><li><code>按住 Command 键点按窗口标题</code>：查看包含当前文件夹的文件夹。</li><li><a href="https://support.apple.com/zh+cn/guide/mac+help/mchlp1378/mac" target="_blank" rel="noreferrer">了解如何使用 Command 或 Shift 在“访达”中选择多个项目</a>。</li><li>点按“访达”菜单栏中的“前往”菜单查看用于打开许多常用文件夹（如“应用程序”、“文稿”、“下载”、“实用工具”和“iCloud 云盘”）的快捷键。</li></ul><h2 id="文稿快捷键" tabindex="-1">文稿快捷键 <a class="header-anchor" href="#文稿快捷键" aria-label="Permalink to &quot;文稿快捷键&quot;">​</a></h2><p>这些快捷键的行为可能因您使用的 App 而异。</p><ul><li><code>Command+B</code>：以粗体显示所选文本，或者打开或关闭粗体显示功能。</li><li><code>Command+I</code>：以斜体显示所选文本，或者打开或关闭斜体显示功能。</li><li><code>Command+K</code>：添加网页链接。</li><li><code>Command+U</code>：对所选文本加下划线，或者打开或关闭加下划线功能。</li><li><code>Command+T</code>：显示或隐藏“字体”窗口。</li><li><code>Command+D</code>：从“打开”对话框或“存储”对话框内选择“桌面”文件夹。</li><li><code>Control+Command+D</code>：显示或隐藏所选字词的定义。</li><li><code>Shift+Command+冒号 (:)</code>：显示“拼写和语法”窗口。</li><li><code>Command+分号 (;)</code>：查找文稿中拼写错误的字词。</li><li><code>Option+Delete</code>：删除插入点左边的字词。</li><li><code>Control+H</code>：删除插入点左边的字符。也可以使用 Delete 键。</li><li><code>Control+D</code>：删除插入点右边的字符。也可以使用 Fn+Delete。</li><li><code>Fn+Delete</code>：在没有向前删除 键的键盘上向前删除。也可以使用 Control+D。</li><li><code>Control+K</code>：删除插入点与行或段落末尾处之间的文本。</li><li><code>Fn+上箭头</code>：Page Up：向上滚动一页。</li><li><code>Fn+下箭头</code>：Page Down：向下滚动一页。</li><li><code>Fn+左箭头</code>：Home：滚动到文稿开头。</li><li><code>Fn+右箭头</code>：End：滚动到文稿末尾。</li><li><code>Command+上箭头</code>：将插入点移至文稿开头。</li><li><code>Command+下箭头</code>：将插入点移至文稿末尾。</li><li><code>Command+左箭头</code>：将插入点移至当前行的行首。</li><li><code>Command+右箭头</code>：将插入点移至当前行的行尾。</li><li><code>Option+左箭头</code>：将插入点移至上一字词的词首。</li><li><code>Option+右箭头</code>：将插入点移至下一字词的词尾。</li><li><code>Shift+Command+上箭头</code>：选中插入点与文稿开头之间的文本。</li><li><code>Shift+Command+下箭头</code>：选中插入点与文稿末尾之间的文本。</li><li><code>Shift+Command+左箭头</code>：选中插入点与当前行行首之间的文本。</li><li><code>Shift+Command+右箭头</code>：选中插入点与当前行行尾之间的文本。</li><li><code>Shift+上箭头</code>：将文本选择范围扩展到上一行相同水平位置的最近字符处。</li><li><code>Shift+下箭头</code>：将文本选择范围扩展到下一行相同水平位置的最近字符处。</li><li><code>Shift+左箭头</code>：将文本选择范围向左扩展一个字符。</li><li><code>Shift+右箭头</code>：将文本选择范围向右扩展一个字符。</li><li><code>Option+Shift+上箭头</code>：将文本选择范围扩展到当前段落的段首，再按一次则扩展到下一段落的段首。</li><li><code>Option+Shift+下箭头</code>：将文本选择范围扩展到当前段落的段尾，再按一次则扩展到下一段落的段尾。</li><li><code>Option+Shift+左箭头</code>：将文本选择范围扩展到当前字词的词首，再按一次则扩展到后一字词的词首。</li><li><code>Option+Shift+右箭头</code>：将文本选择范围扩展到当前字词的词尾，再按一次则扩展到后一字词的词尾。</li><li><code>Control+A</code>：移至行或段落的开头。</li><li><code>Control+E</code>：移至行或段落的末尾。</li><li><code>Control+F</code>：向前移动一个字符。</li><li><code>Control+B</code>：向后移动一个字符。</li><li><code>Control+L</code>：将光标或所选内容置于可见区域中央。</li><li><code>Control+P</code>：上移一行。</li><li><code>Control+N</code>：下移一行。</li><li><code>Control+O</code>：在插入点后新插入一行。</li><li><code>Control+T</code>：将插入点后面的字符与插入点前面的字符交换。</li><li><code>Command+左花括号 ({)</code>：左对齐。</li><li><code>Command+右花括号 (})</code>：右对齐。</li><li><code>Shift+Command+竖线 (|)</code>：居中对齐。</li><li><code>Option+Command+F</code>：前往搜索栏。</li><li><code>Option+Command+T</code>：显示或隐藏 App 中的工具栏。</li><li><code>Option+Command+C</code>：拷贝样式：将所选项的格式设置拷贝到剪贴板。</li><li><code>Option+Command+V</code>：粘贴样式：将拷贝的样式应用到所选项。</li><li><code>Option+Shift+Command+V</code>：粘贴并匹配样式：将周围内容的样式应用到粘贴在该内容中的项目。</li><li><code>Option+Command+I</code>：显示或隐藏检查器窗口。</li><li><code>Shift+Command+P</code>：页面设置：显示用于选择文稿设置的窗口。</li><li><code>Shift+Command+S</code>：显示“存储为”对话框或复制当前文稿。</li><li><code>Shift+Command+减号 (+)</code>：缩小所选项。</li><li><code>Shift+Command+加号 (+)</code>：放大所选项。<code>Command+等号 (=) </code> 可实现相同的功能。</li><li><code>Shift+Command+问号 (?)</code>：打开“帮助”菜单。</li></ul><p><img src="https://mondaylab+1309616765.cos.ap+shanghai.myqcloud.com/images/202210132151022.png" alt="img"></p><h2 id="其他快捷键" tabindex="-1">其他快捷键 <a class="header-anchor" href="#其他快捷键" aria-label="Permalink to &quot;其他快捷键&quot;">​</a></h2><p>如需了解更多快捷键，请查看 App 菜单中显示的快捷键缩写。每个 <code>App</code> 都有自己的快捷键，在一个 <code>App</code> 中可用的快捷键可能在另一个 <code>App</code> 中不可用。</p><ul><li><a href="https://support.apple.com/zh+cn/HT204434" target="_blank" rel="noreferrer">辅助功能快捷键</a></li><li><a href="https://support.apple.com/zh+cn/guide/safari/keyboard+and+other+shortcuts+cpsh003/mac" target="_blank" rel="noreferrer">Safari 浏览器快捷键</a></li><li><a href="https://support.apple.com/zh+cn/guide/mac+help/spotlight+keyboard+shortcuts+mh26783/mac" target="_blank" rel="noreferrer">“聚焦”快捷键</a></li><li><a href="https://support.apple.com/zh+cn/HT201255" target="_blank" rel="noreferrer">启动快捷键</a></li><li>Apple Music 快捷键：从“音乐”App 的菜单栏中选取“帮助”&gt;“键盘快捷键”。</li><li>其他快捷键：选取苹果菜单 &gt;“系统偏好设置”，点按“键盘”，然后点按“<a href="https://support.apple.com/zh+cn/guide/mac+help/use+global+keyboard+shortcuts+mchlp2262/mac" target="_blank" rel="noreferrer">快捷键</a>”。</li></ul><h2 id="进一步了解" tabindex="-1">进一步了解 <a class="header-anchor" href="#进一步了解" aria-label="Permalink to &quot;进一步了解&quot;">​</a></h2><ul><li><a href="https://support.apple.com/zh+cn/guide/mac+help/use+emoji+and+symbols+on+mac+mchlp1560/mac" target="_blank" rel="noreferrer">键入表情符号、重音符号和其他符号</a></li><li><a href="https://support.apple.com/zh+cn/guide/mac+help/create+keyboard+shortcuts+for+apps+mchlp2271/mac" target="_blank" rel="noreferrer">创建您自己的快捷键</a>以及<a href="https://support.apple.com/zh+cn/guide/mac+help/if+a+keyboard+shortcut+doesnt+work+mchlp2864/mac" target="_blank" rel="noreferrer">解决快捷键之间的冲突</a></li><li>更改<a href="https://support.apple.com/zh+cn/HT204436" target="_blank" rel="noreferrer">功能键</a>或<a href="https://support.apple.com/zh+cn/guide/mac+help/change+the+behavior+of+the+modifier+keys+mchlp1011/mac" target="_blank" rel="noreferrer">修饰键</a>的行为</li><li><a href="https://support.apple.com/zh+cn/HT203085" target="_blank" rel="noreferrer">使用键盘快捷键的语音命令</a></li></ul>',18),a=[i];function t(n,m,r,p,h,C){return e(),d("div",null,a)}const u=o(c,[["render",t]]);export{f as __pageData,u as default};
